void negativeTestResponseTemplate(){
    final ResponseDefinition responseDefinition =
        this.transformer.transform(
            mockRequest()
                .url("/soap")
                .body(
                    "<soap:Envelope xmlns:soap=\"http://www.w3.org/2003/05/soap-envelope/\"><soap:Body><m:a><m:test>success</m:test></m:a></soap:Body></soap:Envelope>"),
            aResponse().withBody("<test>{{soapXPath request.body '/b/test'}}</test>").build(),
            noFileSource(),
            Parameters.empty());

    assertThat(responseDefinition.getBody(), is("<test></test>"));
  }

void rendersASimpleValue(){
    final ResponseDefinition responseDefinition =
        this.transformer.transform(
            mockRequest().url("/xml").body("<a><test>success</test></a>"),
            aResponse().withBody("<test>{{xPath request.body '/a/test/text()'}}</test>").build(),
            noFileSource(),
            Parameters.empty());

    assertThat(responseDefinition.getBody(), is("<test>success</test>"));
  }

void rendersNothingWhenTheXPathExpressionResolvesNoContent(){
    final ResponseDefinition responseDefinition =
        this.transformer.transform(
            mockRequest().url("/xml").body("<a><test>success</test></a>"),
            aResponse().withBody("<test>{{xPath request.body '/b/test'}}</test>").build(),
            noFileSource(),
            Parameters.empty());

    assertThat(responseDefinition.getBody(), startsWith("<test></test>"));
  }
